26	[{"id": "05b7c224-c810-4008-8828-5ff3b0b6f1d0", "type": "paragraph", "value": "<h2 data-block-key=\\"kpxyk\\">Autres exemples</h2><p data-block-key=\\"6f2pa\\">Il est également possible de créer des bandeaux d'appel à action avec d'autres types de blocs. Voici quelques exemples.</p>"}, {"id": "5ee3b960-7133-445e-9e05-045751bbf70b", "type": "fullwidthbackground", "value": {"content": [{"type": "text_cta", "value": {"text": "<h2 data-block-key=\\"xmc3p\\">Texte avec appel à action, sur fond pleine largeur</h2><p data-block-key=\\"51v2r\\">Le \\"fond pleine largeur\\" peut être une image de votre choix, ou l'une des couleurs du Système de Design de l'Etat (DSFR).</p><p data-block-key=\\"433ba\\">Pour cet exemple, nous avons opté pour une image en fond.</p>", "cta_url": "", "cta_label": "", "cta_buttons": [{"type": "buttons", "value": [{"type": "button", "value": {"page": null, "text": "Bouton primaire avec icône", "document": null, "icon_side": "fr-btn--icon-left", "icon_class": "fr-icon-award-line", "button_type": "fr-btn", "external_url": ""}}]}]}}], "bg_image": 78, "bg_color_class": ""}}, {"id": "f94dc2ef-3418-405b-a540-43d52c372d29", "type": "fullwidthbackground", "value": {"content": [{"type": "text_cta", "value": {"text": "<h2 data-block-key=\\"beife\\">Texte avec appel à action, sur fond pleine largeur</h2><p data-block-key=\\"9imau\\">Pour cet exemple, nous avons opté pour un \\"fond pleine largeur\\" de couleur grise, et nous y avons inséré un \\"texte avec appel action\\".</p><p data-block-key=\\"b573u\\"></p><p data-block-key=\\"9jepn\\">Voici les différents types de bouton (\\"appel à action\\") disponibles :</p>", "cta_url": "", "cta_label": "", "cta_buttons": [{"type": "buttons", "value": [{"type": "button", "value": {"page": null, "text": "Un bouton primaire", "document": null, "icon_side": "", "icon_class": "", "button_type": "fr-btn", "external_url": ""}}, {"type": "button", "value": {"page": null, "text": "Un bouton secondaire", "document": null, "icon_side": "", "icon_class": "", "button_type": "fr-btn fr-btn--secondary", "external_url": ""}}, {"type": "button", "value": {"page": null, "text": "Un bouton tertiaire", "document": null, "icon_side": "", "icon_class": "", "button_type": "fr-btn fr-btn--tertiary", "external_url": ""}}, {"type": "button", "value": {"page": null, "text": "Un bouton tertiaire sans bordure", "document": null, "icon_side": "", "icon_class": "", "button_type": "fr-btn fr-btn--tertiary-no-outline", "external_url": ""}}]}]}}], "bg_image": null, "bg_color_class": "grey"}}, {"id": "9c5be265-326e-4f16-b5bb-766490b20236", "type": "multicolumns", "value": {"title": "Multi-colonnes", "columns": [{"type": "text_cta", "value": {"text": "<p data-block-key=\\"alpf0\\">Pour cet exemple, nous avons opté pour un bloc \\"multi-colonne\\", en insérant :</p><ul><li data-block-key=\\"bv8ev\\">un \\"texte et appel à action\\" dans la colonne 1</li><li data-block-key=\\"7p7kg\\">une image dans la colonne 2</li></ul><p data-block-key=\\"9hhgu\\">Il est possible de choisir une couleur de fond pour votre bloc \\"multi-colonne\\". Nous avons sélectionné ici \\"gris galet\\".</p><p data-block-key=\\"9maco\\"></p>", "cta_url": "", "cta_label": "", "cta_buttons": [{"type": "buttons", "value": [{"type": "button", "value": {"page": 34, "text": "Bouton primaire", "document": null, "icon_side": "", "icon_class": "", "button_type": "fr-btn", "external_url": ""}}]}]}}, {"type": "image", "value": {"alt": "", "url": "", "image": 82, "title": "", "width": "fr-content-media--sm", "caption": "", "heading_tag": "", "image_ratio": "fr-ratio-3x2"}}], "bg_color": "", "bg_image": null, "heading_tag": "", "bg_color_class": "beige-gris-galet"}}]	\N	t	76	f	t	<p data-block-key="irw4q">Vous pouvez créer une en-tête comme celle-ci, en vous rendant dans l'onglet "Promotion" de votre page, puis en choisissant les "Options d'en-tête".</p><p data-block-key="9u080"></p><p data-block-key="eujil">Vous pourrez y insérer une image ou une couleur de fond, ainsi que du texte formaté et des boutons d'appel à action.</p><p data-block-key="cpkig"></p><p data-block-key="172l8">Cette en-tête apparaîtra lorsque des aperçus de votre page seront générés.</p>	[{"id": "7a709cda-d544-492b-812b-26e7f5b41fe4", "type": "buttons", "value": [{"id": "0ee1a462-98a6-4261-a117-e56c331fcbb3", "type": "button", "value": {"page": 37, "text": "Bouton d'appel à action", "document": null, "icon_side": "", "icon_class": "", "button_type": "fr-btn", "external_url": ""}}]}]	http://sites-faciles.beta.numerique.gouv.fr/exemples/en-t%C3%AAtes-et-bandeaux-dappel-%C3%A0-action/	\N	""
