28	[{"id": "93864a72-d34e-4bf5-a41f-42fc9b2c8f73", "type": "imageandtext", "value": {"link": {"icon": "", "page": null, "size": "", "text": "", "document": null, "external_url": ""}, "page": null, "text": "<h2 data-block-key=\\"0ruyo\\">Bloc \\"Image et texte\\"</h2><p data-block-key=\\"etjrq\\"><i>Vous pouvez choisir la disposition de l'image (gauche ou droite) et ses dimensions. Vous pouvez également mettre ce texte en forme (</i><b><i>gras</i></b><i>, italique, listes à puce, listes numérotées, liens hypertexte...).</i></p><hr/><p data-block-key=\\"9op7q\\">Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.</p>", "image": 80, "link_url": "", "image_side": "right", "link_label": "", "image_ratio": "5"}}, {"id": "95ccde19-2305-4083-9142-1310381de54f", "type": "fullwidthbackground", "value": {"content": [{"type": "text", "value": "<h2 data-block-key=\\"r6nbg\\">Texte avec mise en forme</h2><p data-block-key=\\"4k2di\\"><i>Vous pouvez mettre le texte en forme (</i><b><i>gras</i></b><i>, italique, listes à puce, listes numérotées, liens hypertexte...).<br/><br/>Pour cet exemple, nous avons inséré le bloc de texte dans un \\"fond pleine largeur\\", qui peut être une couleur ou l'image de votre choix. Ici, nous avons choisi la couleur \\"Bleu France\\".</i></p><hr/><p data-block-key=\\"fu722\\">Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.</p>"}], "bg_image": null, "bg_color_class": "blue-france"}}, {"id": "85af2722-a947-4c1c-b667-6848692103ec", "type": "paragraph", "value": "<h2 data-block-key=\\"b1v1c\\">Image seule</h2><p data-block-key=\\"cnkho\\">Utilisez un bloc 'image\\" pour cela. Vous pourrez choisir 